import React, { Component, Fragment} from 'react';

import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

class addressBar extends Component {
  render() {
    var imageStyle = {
      width: "40%",
      display: 'block',
      marginLeft:"auto",
      marginRight: "auto",
      marginTop:"10%",
      marginBottom:"10%"
    }

    return (
      <Paper elevation={3} style={{position: 'fixed', bottom:"5%", left:"5%", width:"80%", background:"WhiteSmoke", padding:"5%", textAlign:"center"
      }}>
          <img src="/no_stores.svg" alt="Hombremirando al vacio" style={imageStyle}></img>
          <h3>Opps! No encontramos almacenes<br></br><small>Pero te tenemos cubierto...</small></h3>
          <p>Si conoces negocios cerca de tu ubicación compartenos los datos y realizaremos el pedido por ti.<br></br><br></br>(también puedes cambiar de úbicación ingresando una nueva dirección)</p>
          <Button variant="contained" color="primary">Hacer pedido en tienda no registrada</Button>
      </Paper>
    );
  }
}

export default addressBar;
